function createStandings(year){

	teamData = {};
	nTeams = 0;
	if (year==2016){
		teams = {'NL': {'W': ['ARI', 'COL', 'LAN', 'SDN', 'SFN'], 'E': ['ATL', 'MIA', 'NYN', 'PHI', 'WAS'], 'C': ['CHN', 'CIN', 'MIL', 'PIT', 'SLN']}, 'AL': {'E': ['BAL', 'BOS', 'NYA', 'TBA', 'TOR'], 'C': ['CHA', 'CLE', 'DET', 'KCA', 'MIN'], 'W': ['HOU', 'ANA', 'OAK', 'SEA', 'TEX']}};
	}
	var len = Object.keys(teams).length;
	for (var i=0;i<len;i++){
		var league = Object.keys(teams)[i];
		var elementLeague = document.getElementById('league'+league);
		elementLeague.innerHTML = '';
		
		var numDivisions = Object.keys(teams[league]).length;
		for (var ii=0;ii<numDivisions;ii++) {
			var division = Object.keys(teams[league])[ii];
			var card = document.createElement('div');
			card.setAttribute('class','col col-sm-6 col-lg-4');
			var card1 = document.createElement('div');
			card1.setAttribute('class','card');
			card.appendChild(card1);
			
			card1 = document.createElement('h2');
			card1.setAttribute('class','card-title');
			card1.textContent = league+' '+division;
			card.appendChild(card1);
			
			var table = document.createElement("table");
			table.setAttribute('id',league+division+'Table');
			var tr = document.createElement("tr");
		
			var td = document.createElement("td");
			td.textContent = 'Teams';
			tr.appendChild(td);
		
			td = document.createElement("td");
			td.textContent = 'Wins';
			tr.appendChild(td);
		
			td = document.createElement("td");
			td.textContent = 'Losses';
			tr.appendChild(td);
			table.appendChild(tr);
			
			var divLen = Object.keys(teams[league][division]).length;
			for (var iii=0;iii<divLen;iii++){
				nTeams+=1;
				var stream1 = new Random();
				teamData[teams[league][division][iii]]={'runs':stream1.normal(5,.4),'allowed':stream1.normal(5,.4),'wins':0,'losses':0};
				tr = document.createElement("tr");
				tr.setAttribute('id',teams[league][division][iii]+'row');
				tr.setAttribute('class','standings');
				td = document.createElement("td");
				td.textContent = teams[league][division][iii];
				tr.appendChild(td);
		
				td = document.createElement("td");
				td.textContent = '0';
				td.setAttribute('id',teams[league][division][iii]+'wins');
				tr.appendChild(td);
		
				td = document.createElement("td");
				td.textContent = '0';
				td.setAttribute('id',teams[league][division][iii]+'losses');
				tr.appendChild(td);
				table.appendChild(tr);
			}
			card.appendChild(table);
			elementLeague.appendChild(card);
		}
	}
	dateList = [];
	dateLen = Object.keys(fullSchedule).length;
	for (var i=0;i<dateLen;i++) {
		dateList.push([Object.keys(fullSchedule)[i],0]);
	}
}



function addGame(dateIndex){

	for (var di=0;di<dateIndex;di++){
		if (dateList[di][1]<1) {
			var schedule = fullSchedule[dateList[di][0]];
	
			for (var i=0;i<schedule.length;i++){
				var stream1 = new Random();
				runs1 = schedule[i]['vruns'];
				runs2 = schedule[i]['hruns'];
				if (runs1>runs2){
					teamData[schedule[i]['vteam']]['wins']+=1;
					teamData[schedule[i]['hteam']]['losses']+=1;
				}
				else if (runs2>runs1){
					teamData[schedule[i]['hteam']]['wins']+=1;
					teamData[schedule[i]['vteam']]['losses']+=1;
				}
				document.getElementById(schedule[i]['vteam']+'wins').textContent=teamData[schedule[i]['vteam']]['wins'];
				document.getElementById(schedule[i]['vteam']+'losses').textContent=teamData[schedule[i]['vteam']]['losses'];
				document.getElementById(schedule[i]['hteam']+'wins').textContent=teamData[schedule[i]['hteam']]['wins'];
				document.getElementById(schedule[i]['hteam']+'losses').textContent=teamData[schedule[i]['hteam']]['losses'];
			}
			
			dateList[di][1]=1;
		}
	}
	for (var di=dateIndex;di<dateLen;di++){
		if (dateList[di][1]==1) {
			var schedule = fullSchedule[dateList[di][0]];
	
			for (var i=0;i<schedule.length;i++){
				var stream1 = new Random();
				runs1 = schedule[i]['vruns'];
				runs2 = schedule[i]['hruns'];
				if (runs1>runs2){
					teamData[schedule[i]['vteam']]['wins']-=1;
					teamData[schedule[i]['hteam']]['losses']-=1;
				}
				else if (runs2>runs1){
					teamData[schedule[i]['hteam']]['wins']-=1;
					teamData[schedule[i]['vteam']]['losses']-=1;
				}
				document.getElementById(schedule[i]['vteam']+'wins').textContent=teamData[schedule[i]['vteam']]['wins'];
				document.getElementById(schedule[i]['vteam']+'losses').textContent=teamData[schedule[i]['vteam']]['losses'];
				document.getElementById(schedule[i]['hteam']+'wins').textContent=teamData[schedule[i]['hteam']]['wins'];
				document.getElementById(schedule[i]['hteam']+'losses').textContent=teamData[schedule[i]['hteam']]['losses'];
			}
			
			dateList[di][1]=0;
		}
	}
	updateStandings();
	
}

function updateStandings() {
	var len = Object.keys(teams).length;
	for (var i=0;i<len;i++){
		var league = Object.keys(teams)[i];
		var elementLeague = document.getElementById('league'+league);
		
		var numDivisions = Object.keys(teams[league]).length;
		for (var ii=0;ii<numDivisions;ii++) {
			var division = Object.keys(teams[league])[ii];
			var divTable = document.getElementById(league+division+'Table');
			
			var divLen = Object.keys(teams[league][division]).length;
			var notSorted = true;
			while (notSorted){
				notSorted = false;
				for (var iii=0;iii<divLen-1;iii++){
					var gbdiff = (teamData[teams[league][division][iii]]['wins']-teamData[teams[league][division][iii]]['losses'])-(teamData[teams[league][division][iii+1]]['wins']-teamData[teams[league][division][iii+1]]['losses']);
					if (gbdiff<0){
						var hold = teams[league][division][iii+1];
						teams[league][division][iii+1]=teams[league][division][iii];
						teams[league][division][iii]=hold;
						divTable.insertBefore(document.getElementById(teams[league][division][iii]+'row'),document.getElementById(teams[league][division][iii+1]+'row'));
						notSorted = true;
					}
					else{
						document.getElementById(teams[league][division][iii]+'row').style.borderBottom=gbdiff+'px solid transparent';
					}
				}
			}
		}
	}
}




